// src/components/LandingPage.js
import React, { useState } from "react";
import axios from "axios";
import { useNavigate, Link } from "react-router-dom";
import "./LandingPage.css";

const FINNHUB_BASE = "https://finnhub.io/api/v1";
const FINNHUB_KEY = "cva1t91r01qpd9sa8bi0cva1t91r01qpd9sa8big";

export default function LandingPage() {
  const navigate = useNavigate();
  const [symbol, setSymbol] = useState("");
  const [quote, setQuote] = useState(null);
  const [error, setError] = useState(false);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setSymbol(e.target.value.trim().toUpperCase());
    setQuote(null);
    setError(false);
  };

  const handleSearch = async () => {
    if (!symbol) return;
    setLoading(true);
    try {
      const response = await axios.get(`${FINNHUB_BASE}/quote`, {
        params: { symbol, token: FINNHUB_KEY }
      });
      const data = response.data;
      if (data && typeof data.c === "number") {
        setQuote(data);
        setError(false);
      } else {
        setQuote(null);
        setError(true);
      }
    } catch (err) {
      console.error("Finnhub quote error:", err);
      setQuote(null);
      setError(true);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="landing-wrapper">
      <header className="landing-header">
        <div className="logo-area">
          <h2 className="logo-text">Finansal Analiz</h2>
        </div>
        <nav className="navbar">
          <Link to="#ozellikler">Özellikler</Link>
          <Link to="#teknolojiler">Teknolojiler</Link>
          <Link to="#hakkimizda">Hakkımızda</Link>
          <Link to="#iletisim">İletişim</Link>
          <Link to="/login">Giriş Yap</Link>
          <Link to="/register">Kayıt Ol</Link>
        </nav>
      </header>
      <main className="landing-main">
        <section className="landing-intro">
          <h1>Bitirme Projesi: Finansal Analiz Uygulaması</h1>
          <p>
            Gelir-gider takibi, bütçe yönetimi ve yatırım önerileri tek platformda.
            Makine öğrenmesi destekli analizlerle daha bilinçli finansal kararlar alın!
          </p>
          <button onClick={() => navigate("/dashboard")}>Hemen Başla</button>
        </section>
        <aside className="landing-market">
          <h2>Piyasalar (Finnhub)</h2>
          <div className="market-search">
            <input
              type="text"
              placeholder="Hisse sembolü (örn: AAPL)"
              value={symbol}
              onChange={handleChange}
            />
            <button onClick={handleSearch} disabled={loading}>
              {loading ? "Yükleniyor..." : "Ara"}
            </button>
          </div>
          {quote && !error ? (
            <div className="quote-result">
              <p>Fiyat: ${quote.c.toFixed(2)}</p>
              <p>Değişim: {quote.d.toFixed(2)} ({quote.dp.toFixed(2)}%)</p>
            </div>
          ) : error ? (
            <p className="no-result">Sonuç bulunamadı.</p>
          ) : null}
        </aside>
      </main>
    </div>
  );
}
